export default class Podacst extends React.Component{
  render() {
    const { high_mp3, image, original, title } = this.props
    return(
      <React.Fragment>
        <div className="podcast-container">
            <img src={ image || original } alt={ title } className="hero" />
            <audio controls autoPlay>
              <source src={ high_mp3 } type="audio/mpeg" />
            </audio>
          </div>
      </React.Fragment>
    )
  }
}
